import { Col, Row } from "react-bootstrap";
import ProductList from "./ProductList";
import useFetch from "./useFetch";

function Books() {
    let url = "http://localhost:8000/product";
    const { data: products, isPending, error } = useFetch(url);
    const myTitle = "Products";

    return (
        <Row>
            <Col sm={1}></Col>
            <Col sm={10} md={6}> {/* Adjust sm and md values accordingly */}
                {error && <div>Error: {error}</div>}
                {isPending && <div>Loading ...</div>}
                {products && <ProductList products={products} title={myTitle} />}
            </Col>
            <Col sm={1}></Col>
        </Row>
    );
}
export default Books;
